            var softTypeList = new List<wsRevisionControlled>();
            if (!fileStorage.ContainsKey(ContentRoleType))
                return null;
            var contentRole = fileStorage[ContentRoleType];
            var file = contentRole.FirstOrDefault(f => f.softType == fullClassName);
            if(file==null)
                return null;
            byte[] image = Convert.FromBase64String("");
